import React, { useState } from 'react';
import { Routes, Route, Link, BrowserRouter as Router } from 'react-router-dom';
import './App.css';

// Halaman Register
function Register() {
  const [username, setUsername] = useState('');
  const [token, setToken] = useState('');

  const handleRegister = async () => {
    try {
      const res = await fetch('http://localhost:3000/api/register', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ username }),
      });

      const data = await res.json();
      if (data.token) {
        setToken(data.token);
        console.log('ðŸŽ« Token:', data.token);
      } else {
        alert('Registrasi gagal');
      }
    } catch (err) {
      console.error('Error:', err);
    }
  };

  return (
    <div>
      <h1>Register</h1>
      <input
        type="text"
        placeholder="Enter username"
        value={username}
        onChange={(e) => setUsername(e.target.value)}
      />
      <button onClick={handleRegister}>Register</button>
      {token && <p>Token: {token}</p>}
    </div>
  );
}

// Halaman Login
function Login() {
  const [username, setUsername] = useState('');
  const [token, setToken] = useState('');

  const handleLogin = async () => {
    try {
      const res = await fetch('http://localhost:3000/api/login', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ username }),
      });

      const data = await res.json();
      if (data.token) {
        setToken(data.token);
        console.log('ðŸŽ« Token:', data.token);
      } else {
        alert('Login gagal');
      }
    } catch (err) {
      console.error('Error:', err);
    }
  };

  return (
    <div>
      <h1>Login</h1>
      <input
        type="text"
        placeholder="Enter username"
        value={username}
        onChange={(e) => setUsername(e.target.value)}
      />
      <button onClick={handleLogin}>Login</button>
      {token && <p>Token: {token}</p>}
    </div>
  );
}

// Halaman Chat (WhatsApp-like Conversation)
function Chat() {
  return (
    <div className="chat-container">
      <h2>Chat Room</h2>
      <div className="chat-box">
        <div className="message">Hello! How are you?</div>
        <div className="message">I'm fine, thanks!</div>
        {/* Anda bisa menambahkan fitur socket.io untuk percakapan real-time */}
      </div>
      <input type="text" placeholder="Type a message..." />
      <button>Send</button>
    </div>
  );
}

// App Component dengan Routing
function App() {
  return (
    <Router>
      <nav>
        <Link to="/register">Register</Link> | 
        <Link to="/login">Login</Link> | 
        <Link to="/chat">Chat</Link>
      </nav>
      <Routes>
        <Route path="/" element={<h1>Welcome to Chat Application</h1>} />
        <Route path="/register" element={<Register />} />
        <Route path="/login" element={<Login />} />
        <Route path="/chat" element={<Chat />} />
      </Routes>
    </Router>
  );
}

export default App;
